import React from "react";
import loginImage from "./resources/images/login.png";

function Test() {
  return (
    <div className="container-fluid">
      <div className="row">
        <div
          className="col-7"
          style={{ backgroundImage: `url(${loginImage})`, height: "100vh" }}
        >
          {/* this part is left side of the division */}
        </div>
        <div className="col-5 d-flex align-items-center justify-content-center " style={{ height: "100vh" }}>
          {/* this part is right side of the division. All the login form will stay here */}
          <form action="">
            <div className="mb-3">
    
              <input type="email" className="form-control rounded-pill" placeholder="Enter email" />
              <input type="email" className="form-control"  placeholder="Enter email"></input>
            </div>
            <div className="mb-3">
             
              <input type="password"className="form-control" placeholder="Enter Password" />
            </div>
            <button className="btn btn-success">Login</button>
            <p>You are agree to our terms and policies</p>
            <button className="btn btn-default border">Create account</button>
          </form>
        </div>
      </div>
    </div>
  );
}

export default Test;
